let logo_section = document.getElementById("logo_section");
const showLogo = (array) => {
  for (let obj of array) {
    const logo = document.createElement("div");
    logo.classList.add(
      "lg:w-1/4",
      "bg-rgb-41-41-41",
      "md:w-1/3",
      "w-full",
      "flex",
      "items-center",
      "justify-center",
      "m-0.5"
    );
    const imageUrl = document.createElement("img");
    console.log(imageUrl);
    imageUrl.classList.add("m-1");
    imageUrl.setAttribute("src", obj.url);
    logo.appendChild(imageUrl);
    logo_section.append(logo);
  }
};

showLogo(data_list);
